  `dictSysCodeDesc` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '字典名称',
  `multiple` tinyint(1) NULL DEFAULT 0 COMMENT '多选字典',
  `dictDepend` int(32) NULL DEFAULT 0 COMMENT '字典依赖类型',
  `dictDependFieldDesc` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '依赖字段名称',
  `dictDependFieldId` int(32) NULL DEFAULT 0 COMMENT '依赖字段ID',
  `attachSuffix` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '附件后缀限制',
  `delectStatus` tinyint(1) NULL DEFAULT 0 COMMENT '等待删除-同步时会将值为true的字段删掉',
