CREATE TABLE `sys_department_leader`  (
  `deptId` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `leaderType` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `userName` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `realName` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `opBy` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人ID',
  `opAt` timestamp(0) NULL DEFAULT NULL COMMENT '创建时间',
  `opByDesc` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人',
  `delFlag` tinyint(1) NULL DEFAULT 0 COMMENT '删除标记',
  PRIMARY KEY (`deptId`, `leaderType`, `userName`) USING BTREE,
  UNIQUE INDEX `pks`(`deptId`, `leaderType`, `userName`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '部门领导关联信息' ROW_FORMAT = Dynamic;

