-- ----------------------------
-- Table structure for sys_error_log_history
-- ----------------------------
DROP TABLE IF EXISTS `sys_error_log_history`;
CREATE TABLE `sys_error_log_history`  (
  `id` int(32) NOT NULL AUTO_INCREMENT,
  `userid` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `userDesc` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `ct` timestamp(0) NULL DEFAULT NULL,
  `path` varchar(300) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `errorMsg` varchar(2000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `errorMsgInfo` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL,
  `opBy` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人ID',
  `opAt` timestamp(0) NULL DEFAULT NULL COMMENT '创建时间',
  `opByDesc` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人',
  `delFlag` tinyint(1) NULL DEFAULT 0 COMMENT '删除标记',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 7 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '系统错误日志' ROW_FORMAT = Dynamic;

