-- ----------------------------
-- Table structure for sys_mail_body
-- ----------------------------
DROP TABLE IF EXISTS `sys_mail_body`;
CREATE TABLE `sys_mail_body`  (
  `uuid` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键',
  `bizType` int(32) NULL DEFAULT NULL COMMENT '业务类型',
  `bizuuid` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '业务编号-在业务中回查邮件信息',
  `subject` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主题',
  `htmlMsg` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '消息内容',
