-- ----------------------------
-- Table structure for sys_options
-- ----------------------------
DROP TABLE IF EXISTS `sys_options`;
CREATE TABLE `sys_options`  (
  `id` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '0' COMMENT '唯一ID',
  `fristLoginNeedChangePass` tinyint(1) NULL DEFAULT 0 COMMENT '第一次登录后需要修改密码',
  `passExpired` int(32) NULL DEFAULT 3 COMMENT '密码定时过期-按月-3个月过期提醒 0永不过期',
  `passStrength` int(32) NULL DEFAULT 0 COMMENT '0无验证  1字母加数字不小于6位  2字母大小写都有加数字  3字母大小写都有加数字加特殊字符',
  `errorPassInputTimes` int(32) NULL DEFAULT 5 COMMENT '登录错误次数限制 输入次数-冻结15分钟',
  `needVerificationCode` int(32) NULL DEFAULT 1 COMMENT '登录错误多少次需要输入验证码 -1 不需要验证码 0一直需要',
  `version` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '系统版本号',
  `registrationTime` timestamp(0) NULL DEFAULT NULL COMMENT '注册时间',
  `registrationExpirationTime` timestamp(0) NULL DEFAULT NULL COMMENT '注册失效时间',
  `unitName` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '单位名称-当单位名称修改后注册码失效-需要重新注册',
  `productLongName` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '系统名称',
  `productEnLongName` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '系统英文名称',
  `productLogo` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '系统logo图片',
  `theme` int(32) NULL DEFAULT 1 COMMENT '系统默认主题',
  `qrCodeLogin` tinyint(1) NULL DEFAULT 0 COMMENT '开启扫描登录',
  `productSortName` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '系统简称',
  `opBy` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人ID',
  `opAt` timestamp(0) NULL DEFAULT NULL COMMENT '创建时间',
  `opByDesc` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人',
  `delFlag` tinyint(1) NULL DEFAULT 0 COMMENT '删除标记',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '系统配置信息' ROW_FORMAT = Dynamic;

