DROP TABLE IF EXISTS `user_data_change_history`;
CREATE TABLE `user_data_change_history`  (
  `uuid` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键',
  `tableId` int(32) NULL DEFAULT NULL COMMENT '表ID',
  `userId` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '标识这条数据是谁的',
  `sourceId` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '旧数据的源ID',
  `oldDataViewJson` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '变更记录信息',
  `delIdsJson` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '删除记录',
  `newDataJson` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '新数据原始缓存',
  `status` int(32) NULL DEFAULT 0 COMMENT '状态 0新增 1修改 2删除',
  `review` int(32) NULL DEFAULT 0 COMMENT '审核状态 0待审核 1通过审核 2未通过审核',
  `reviewOpinion` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '审核意见',
  `addUserId` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '添加人员-管理员或用户',
  `addDate` datetime(0) NULL DEFAULT NULL COMMENT '添加时间',
  `reviewUserId` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '审核人',
  `reviewDate` datetime(0) NULL DEFAULT NULL COMMENT '审核时间',
  `opBy` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人ID',
  `opAt` timestamp(0) NULL DEFAULT NULL COMMENT '创建时间',
  `opByDesc` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人',
  `delFlag` tinyint(1) NULL DEFAULT 0 COMMENT '删除标记',
  PRIMARY KEY (`uuid`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '用户数据变更记录' ROW_FORMAT = Dynamic;

