-- ----------------------------
-- Function structure for Find_Like_Set
-- ----------------------------
DROP FUNCTION IF EXISTS `Find_Like_Set`;
delimiter ;;
CREATE DEFINER=`yhsoft`@`%` FUNCTION `Find_Like_Set`(str1 varchar(100),str2 varchar(100)) RETURNS int(11)
BEGIN
    declare ii int ;
	set ii = 0;
	while length(str1)>0 do
      set ii=FIND_IN_SET(str1,str2);
	  if ii>0 then
	    set ii = 1;
		set str1 = '';
	  else
	    set ii = 0;
	    if length(str1) = 0 then
		  set str1 = '';
		else
	      set str1 = left(str1,length(str1)-1);
		end if;
	  end if;
	end while;
    return ii;
END
;;
delimiter ;

-- ----------------------------
-- Function structure for getAgeByIdCard
-- ----------------------------
DROP FUNCTION IF EXISTS `getAgeByIdCard`;
delimiter ;;
CREATE DEFINER=`yhsoft`@`%` FUNCTION `getAgeByIdCard`(idCard varchar(18)) RETURNS int(11)
BEGIN
  declare birthday datetime;
  declare y int;
  declare m int;
  declare year varchar(100);
  declare month varchar(100);
  declare day varchar(100);
  declare idLength int;
  set idLength= len(idCard);
  if (idLength = 18) then
  begin
    set year = substring(idCard,7,4),month = substring(idCard,11,2),day = substring(idCard,13,2);
  end;
  else if(idLength = 15) then
  begin
	set year = substring(idCard,7,2) + 1900,month = substring(idCard,9,2),day = substring(idCard,11,2);
  end;
  else
	return -1;
  end if;
  end if;


  if(year > DATE_FORMAT(now(),'%Y') or not(month between 1 and 12) or not(day between 1 and 31)) then
	return -1;
  else
    set birthday = str_to_date(CONCAT(month,'/',day,'/',year), '%m/%d/%Y');
  end if;

  set y = TIMESTAMPDIFF(year,birthday,now());
  return y;
END
;;
delimiter ;

