-- ----------------------------
-- Function structure for U_GetDateInternal
-- ----------------------------
DROP FUNCTION IF EXISTS `U_GetDateInternal`;
delimiter ;;
CREATE DEFINER=`yhsoft`@`%` FUNCTION `U_GetDateInternal`(type_str VARCHAR(10),beginDate datetime,endDate datetime) RETURNS int(11)
BEGIN
  declare ii int;
  if (type_str = 'year') then
	set ii = TIMESTAMPDIFF(year,beginDate,endDate);
  else if (type_str = 'month') then
	set ii = TIMESTAMPDIFF(month,beginDate,endDate);
  else if (type_str = 'day') then
	set ii = TIMESTAMPDIFF(day,beginDate,endDate);
  else
	return ii = 0;
  end if;
  end if;
  end if;

  return ii;
END
;;
delimiter ;

-- ----------------------------
-- Function structure for U_GetSexFromIdentity
-- ----------------------------
DROP FUNCTION IF EXISTS `U_GetSexFromIdentity`;
delimiter ;;
CREATE DEFINER=`yhsoft`@`%` FUNCTION `U_GetSexFromIdentity`(idCard varchar(18)) RETURNS varchar(2) CHARSET utf8
BEGIN
  declare idLength int;
  declare sex varchar(2);
  set idLength= len(ltrim(rtrim(idCard)));
  if (idLength = 18) then
  begin
    
    if (CAST(substring(idCard,17,1) AS SIGNED) % 2 = 1) then
      set sex = '男';
	else
      set sex = '女';
	end if;
  end;
  else if(idLength = 15) then
  begin
    
    if (CAST(substring(idCard,15,1) AS SIGNED) % 2 = 1) then
      set sex = '男';
	else
      set sex = '女';
	end if;
  end;
  else
	set sex = null;
  end if;
  end if;

  return sex;
END
;;
delimiter ;

